        <div class=""portfolio-text mb-100"">
            <div class=""row"">
                <div class=""col-12 col-lg-7"">
                    <h5>創辦人故事</h5>
                    <p>&emsp;&emsp;Joy Lee 年紀輕輕即獲得職業咖啡師殊榮的達人咖啡師，輾轉停留於多國、多間聞名世界的頂尖咖啡廳，卻始終沒有找到自己的志業。2018年底，初訪南美的Joy Lee終於在哥倫比亞遇到改變自己人生的一次交談。</p>
                    <p>&emsp;&emsp;咖啡師的專業背景，促使Joy Lee遊走各國城市時，往往都會特別安排一兩日到當地的咖啡莊園觀覽，多年的遊歷經歷，她見識過許多咖啡莊園的工人在沒有穿防護衣的情況下直接施用化學肥料、除蟲劑等，Joy Lee對此雖然於心不忍，但也不能多說什麼？然而，在哥倫比亞，她遇到了一間特別的咖啡莊園，莊園內的工人穿戴裝業防護服進行工作，也幾乎沒有看到童工存在，這讓她不由得感到詫異無比，好奇這間莊園的特殊之處。經與莊園主人洽詢，才知道該莊園原來加入了樹蛙雨林聯盟！</p>
                    <p>&emsp;&emsp;在哥倫比亞的特殊體驗後，Joy Lee認識到了雨林聯盟這個國際組織，經過多方了解，發現聯盟的使命和作為皆與自己的理念及其相符，深受觸動，投身進行推廣。目前Joy Lee在台灣，是非常有名的咖啡師，許多政商名流聚會時也會邀請她前往展露身手。Joy Lee亦趁此機會推廣樹蛙雨林聯盟及轄下產品。</p>
                </div>
                <div class=""col-12 col-lg-5"">
                    <h5>成就與獎項</h5>
                    <ul>
                        <li><i class=""fa fa-check""></i> 世界盃杯測師大賽 (WCTC)&emsp;&emsp;冠軍</li>");
            WriteLiteral(@"
                        <li><i class=""fa fa-check""></i> 世界盃沖煮大賽 (WBrC)&emsp;&emsp;亞軍</li>
                        <li><i class=""fa fa-check""></i> 台灣咖啡大師比賽&emsp;&emsp;亞軍</li>
                        <li><i class=""fa fa-check""></i> Big 7 Travel評選「亞洲50 間最棒咖啡店」&emsp;&emsp;第三名</li>
                    </ul>
                </div>
                <div class=""col-12"">
                    <h5>創辦西夏普咖啡</h5>
                    <p>&emsp;&emsp;2021年，新冠疫情影響全球，Joy Lee迫不得已回到了台灣，閒暇時間與幾位好友合資開創了「西夏普咖啡」，透過Joy Lee的專業背景與多國遊歷的經歷，西夏普咖啡從世界各地的莊園中取得風味各具匠心的咖啡豆，讓國人可以體驗經專業咖啡師嚴選的經典咖啡。另外，基於Joy Lee本人的希望，西夏普咖啡也將「樹蛙雨林聯盟」認證的咖啡豆特別列式並進行多方堆廣，讓西夏普的用戶在品嘗美味咖啡的同時，也能為地球的熱帶雨林與受壓迫的咖啡農盡一份心力！</p>
